- input: "TEXT\x1CC00006080\x1CX0\x1C\x1CF3XA\x1CJodi Winship\t\t\t\t  Reports Analysis
    Division  Federal Election Commission  999 E Street, NW  Washington, DC 20463
    \   Identification Number:\tC00006080    Reference:\tNovember Monthly Report (10/1/07
    ? 10/31/07)    Ms. Winship,    Thank you for your December 12, 2007, letter requesting
    additional information pertaining to AHCA-PAC?s November Monthly report.  AHCA-PAC
    recently engaged a new vendor to administer our PAC database.  As we continue
    to familiarize ourselves with the new software, we regret that some administrative
    errors were made.  We are working hard to ensure that these errors are not repeated
    in the future.    In response to your letter requesting additional information
    for three items, please find below a description of the remedial efforts we have
    taken:     1.\tThis amended November Monthly Report will be filed with the Federal
    Election Commission today to report the office sought and state for each contribution
    made to a federal candidate on Schedule B.    2.\tDue to duplicate records in
    our new PAC database, an excessive contribution of $3,750 was received from Mark
    Woolpert, causing him to go over the $5,000 annual contribution limit to federal
    PACs.  A $3,750 refund was made to Mr. Woolpert on January 14, 2008.  A copy of
    the refund check will be sent to you today and will be disclosed on the appropriate
    AHCA-PAC report.    3.\tSimilar duplicate records in our new PAC database resulted
    in an excessive contribution of $2,500 reported on our November Monthly report
    to Together for Our Majority Political Action Committee (TOMPAC).  AHCA-PAC quickly
    realized the error and was able to retrieve and void the excessive $2,500 contribution.
    \ A copy of the voided check will be sent to you today and will be disclosed on
    the appropriate AHCA-PAC report.    You also noted in your letter that AHCA-PAC
    should disclose contributions from political committees on Line 11(c) of Schedule
    A.  We will be sure to do so in subsequent reports.    Please contact us with
    any questions.  Thank you for the opportunity to address these issues.    Heather
    Cutler  Director, AHCA-PAC  American Health Care Association  1201 L Street, NW
    \ Washington, DC 20005  Tel:\t202/898-2856  Fax:\t202/842-3860  E-mail:\thcutler@ahca.org
    \ "
